import React, { useState } from 'react'
import Button from 'react-bootstrap/Button'
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Grid from '@mui/material/Grid';
import Container from '@mui/material/Container';
import FormControl from '@mui/material/FormControl';
import Form from 'react-bootstrap/Form'

const HandleFeaturesDataToPredict = ({features, onSubmit}) => {
    const [featuersValuesDict, setFeatuersValuesDict] = useState({})
    //const [textValueMessage, setTextValueMessage] = useState("")
    //const [textValueError, setTextValueError] = useState(false)

    const handleSubmit = e => {
        console.log(e)
    }

    const handleClick = e => {
        e.preventDefault();
        console.log(e)
        console.log(e.target.labels[0].childNodes)
    }
    

    const handleTextChange = e => {
        setTextValue(e.target.value)
    }

    const handleTextFieldClick = e => {
        let featureTextChanged = e.target.labels[0].childNodes[0].data;
        console.log(featureTextChanged)
        featuersValuesDict[featureTextChanged] = e.target.value
        //{currFeatureChanged: featureChanged}
        print(featuersValuesDict)
    }

    return (
        //<Container maxWidth='md' sx={{width: "90%"}}>
        <Container>
            <FormControl onSubmit={handleSubmit}>
                <Grid container spacing={0}>
                    {features.map((feature, index) => 
                    <>
                        <Grid key={index} item xs={2}>
                            <TextField 
                                key={index} 
                                label={feature}
                                onChange={handleTextFieldClick}/>
                        </Grid>
                    </>
                    )}
                </Grid>

                <Button type="submit">click</Button>
            </FormControl>
        </Container>
    );
}

export default HandleFeaturesDataToPredict
